import React from 'react';
import './App.css';
import { Provider } from 'react-redux'; // Importamos Provider
import store from './store'; // Importamos la tienda de Redux
import Counter from './Counter'; // Importamos el componente Counter

function App() {
  return (
    <Provider store={store}>
      {/* Utilizamos el Provider para proporcionar la tienda de Redux */}
      <div className="App">
        <h1>Aplicaci√≥n con Redux</h1>
        <Counter /> {/* Renderizamos el componente Counter */}
      </div>
    </Provider>
  );
}

export default App;
